public void assertAnalyzesTo(Analyzer a, 
                             String input, 
                             String[] output) throws Exception {
  TokenStream ts = a.tokenStream("dummy", new StringReader(input));
  for (int i=0; i<output.length; i++) {
    Token t = ts.next();
    assertNotNull(t);
    assertEquals(t.termText(), output[i]);
  }
  assertNull(ts.next());
  ts.close();
}

